import ProductItem from './ProductItem';
import classes from './Products.module.css';

const DUMMY_PRODUCTS=[
  {id:"p1",price:6,title:"My first book", description:"The frist book I ever wrote"},
  {id:"p2",price:5,title:"My second book", description:"The second book I ever wrote"},
  {id:"p3",price:7,title:"My third book", description:"The third book I ever wrote"},
  {id:"p4",price:3,title:"My fourth book", description:"The fourth book I ever wrote"}
]

const Products = (props) => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul>
        {DUMMY_PRODUCTS.map(function(product){
          return(
            <ProductItem key={product.id} id={product.id} title={product.title} price={product.price} description={product.description}></ProductItem>
          )
        })}
      </ul>
    </section>
  );
};

export default Products;
